    - type: Paper
      content: >2-
                    [italic]- It's difficult to translate, mostly due
                         to chickenscratch handwriting.
                          Still, you think you get the gist. -[/italic]

        [font="Playwrite"]It's just me now.


        Crops are doing okay. The lanterns seem to be holding some of the things back, and I think our pet demon is behaving itself for the time being.


        Still no word from the other outposts, obviously.


        It's funny. I wouldn't have bet on us being the last. But I think we're the last.


        I'm so tired. The rains won't let up. Nothing but my own whispers to keep me company. Since I can't talk, you'd think I'd be writing more. Ha. Somehow it feels worse to write. Like trying to swim in quicksand. Easier to just stay still.


        She was the scholar. She was the one who wrote everything down. She understood so much about this place, and still it claimed her. What chance do I have?


        I think she took her notes with her when she left.


        I didn't understand why she left before. Now I do. Right now I would do anything just to hear a human voice.


        When they call to me, I think I will go.


        Maybe my tree will grow next to hers.[/font]
